const newJson1 = [
  {
    value: "2300",
    label: "CDMX C.P. 02300",
  },
  {
    value: "45679",
    label: "JALISCO C.P. 45679",
  },
  {
    value: "66628",
    label: "NUEVO LEON C.P. 66628",
  },
];

const MxExpoPallet = ({ finales, setfinales }) => {
  const formatter = new Intl.NumberFormat("en-US", {
    style: "currency",
    currency: "USD",
    minimumFractionDigits: 2,
  });

  const theme = useTheme();
  const cardStyle = {
    background:
      theme.palette.mode === "dark"
        ? theme.palette.dark.main
        : theme.palette.grey[50],
    border: "1px solid",
    borderColor:
      theme.palette.mode === "dark"
        ? theme.palette.dark.main
        : theme.palette.grey[100],
  };

  const [valued, setvalued] = useState({
    codigo_fba: "PHX5",
    fedexwarehouse: "",
    qty_pallet: "",
    totalout: "",
    arreglodelpack: [],
    fob: "",
  });

  const [fletetotal, setfletetotal] = useState({
    total: 0,
  });

  const [aparecidos, setaparecidos] = useState({
    totalaparecido: false,
  });

  const handleChange = (e) => {
    setvalued({
      ...valued,
      fedexwarehouse: e.target.value,
    });
    setaparecidos({
      totalaparecido: false,
    });
  };

  const handleqtyChange = (e) => {
    setvalued({
      ...valued,
      qty_pallet: parseInt(e.target.value, 10),
      totalaparecido: false,
    });
    setaparecidos({
      totalaparecido: false,
    });
  };

  const handlefobChange = (e) => {
    setvalued({
      ...valued,
      fob: parseInt(e.target.value, 10),
      totalaparecido: false,
    });
    setaparecidos({
      totalaparecido: false,
    });
  };

  const calcular = () => {
    if (
      valued.qty_pallet === "" ||
      valued.fedexwarehouse === "" ||
      valued.qty_pallet > 12
    ) {
      Swal.fire({
        title: "oops!",
        text: "Input Correct Information (Max 12 Pallets)!!",
        icon: "warning",
      });
    } else {
      setaparecidos({
        totalaparecido: true,
      });
      GetMexico({ valued }).then((result) =>
        setfinales({
          ...finales,
          totalflete: result,
          bodegamx: valued.fedexwarehouse,
          qtypallets: valued.qty_pallet,
        })
      );
    }
  };

  return (
    <div>
      <SubCard title="Seleccione Bodega Origen en Mexico">
        <Card sx={cardStyle}>
          <CardContent
            sx={{ minHeight: 240, color: theme.palette.common.black }}
          >
            <FormControl variant="outlined">
              <InputLabel id="mxwarehouse">Warehouse MX</InputLabel>
              <Select
                labelId="mxwarehouse"
                onChange={handleChange}
                value={valued.fedexwarehouse}
                label="Fedex Warehouse MX"
                color="secondary"
              >
                {newJson1.map((option) => (
                  <MenuItem key={option.value} value={option.value}>
                    {option.label}
                  </MenuItem>
                ))}
              </Select>
              <br />
              <TextField
                id="qty_pallet"
                name="qty_pallet"
                variant="outlined"
                label="Pallets to Export"
                color="secondary"
                type="number"
                value={valued.qty_pallet || ""}
                onChange={handleqtyChange}
              />
              <br />

              <br />
              <Button color="primary" variant="contained" onClick={calcular}>
                Search Rates
              </Button>
            </FormControl>

          </CardContent>
        </Card>
      </SubCard>

      <Grid container spacing={3}>
        <Grid item xs={6}>
          <Paper style={{ backgroundColor: "#F6F6F6" }}>
            <Grid item xs={12}>
              <Paper>
                <FormControl variant="outlined">
                  <InputLabel id="mxwarehouse">Warehouse MX</InputLabel>
                  <Select
                    labelId="mxwarehouse"
                    onChange={handleChange}
                    value={valued.fedexwarehouse}
                    label="Fedex Warehouse MX"
                    color="secondary"
                  >
                    {newJson1.map((option) => (
                      <MenuItem key={option.value} value={option.value}>
                        {option.label}
                      </MenuItem>
                    ))}
                  </Select>
                  <br />
                  <TextField
                    id="qty_pallet"
                    name="qty_pallet"
                    variant="outlined"
                    label="Pallets to Export"
                    color="secondary"
                    type="number"
                    value={valued.qty_pallet || ""}
                    onChange={handleqtyChange}
                  />
                  <br />

                  <br />
                  <Button
                    color="primary"
                    variant="contained"
                    onClick={calcular}
                  >
                    Search Rates
                  </Button>
                </FormControl>
              </Paper>
            </Grid>
          </Paper>
          <br />
        </Grid>
        <Grid item xs={6}>
          {aparecidos.totalaparecido ? (
            <Paper>
              <MxExpoPalletTotal
                setfletetotal={setfletetotal}
                valued={valued}
              />
              <br />
              {/* Insurance (optional):
							<Typography style={{ color: '#FF9900' }}>
								<strong>
									{valued.fob
										? valued.fob * 0.003 < 40
											? formatter.format(40)
											: formatter.format(valued.fob * 0.003)
										: 'Not Request'}
								</strong>
							</Typography>*/}
            </Paper>
          ) : null}
          <br />
          <Paper>
            <h6>
              Recogida desde la bodega del Seller sin costo, si esta ubicada en
              el area metropolitana de alguna de las ciudades donde estan
              ubicadas las 3 bodegas de Fedex indicadas; Despacho Auanero
              Export-Import; transporte hasta Laredo; y recepcion & manejo en
              bodega de Laredo, TX para conectar con operador de utima milla
              seleccionado por el Seller. No incluye costos por aranceles que
              defina la Aduanas de USA y la fianza ante Aduanas de USA (que debe
              prepagarse independientemente)
            </h6>
          </Paper>
        </Grid>{" "}
      </Grid>
    </div>
  );
};

export default MxExpoPallet;
